import React from 'react'

const About = () => {
  return (

      <div className="about">
        <img id="headshot" src="https://s3.us-east-2.amazonaws.com/eyg.portfolio/outdoor_headshot.jpg"/>
        <p> Full stack web developer with experience in React, Redux, Ruby on Rails, and JavaScript with over five years of experience in nonprofit administration. </p>
      </div>
  );
};

export default About;
